import React from 'react';
import { useContext } from 'react';
import { userData } from '../App';
import Event from './animatedEvent';
import Friendevent from './Friendevent';
import axios from 'axios';
import { leaveEvent } from './Home';
export default function Archive() {
   const [user] = useContext(userData);
   return (
      <div className="float mt-5">
         {user &&
            user.events.valify().map((item, index) =>
               item.creator == user.uuid ? (
                  <Event
                     index={index}
                     title={item.title}
                     date={item.date}
                     duration={item.duration}
                     onDelete={() => leaveEvent(user, item.eventid)}
                  />
               ) : null
               // <Friendevent
               //    index={index}
               //    title={item.title}
               //    date={item.date}
               //    duration={item.duration}
               //    owner={item.username}
               //    onLeave={() => leaveEvent(item.eventid)}
               // />
            )}
      </div>
   );
}
